var Plugins={add:function(b){var a='<div class="plugin-wrapper" id="'+b.id+'"><div class="plugin" style="background-image:url('+b.icon+');"><div class="plugin-details"><div class="plugin-header"><span class="plugin-title">'+b.title+'</span><span class="plugin-version">'+b.version+'</span></div><div class="desc-description">'+b.desc+"</div></div></div></div>";$("#plugins-list").append(a)}};$(document).ready(function(){var a=PluginsView.list();for(var b=0;b<a.length;b++){Plugins.add(a[b])}});if(typeof PluginsView==="undefined"){PluginsView={list:function(){return[]}}};